    rustls-tls = ["reqwest/rustls-tls"]


    [dependencies]

    anyhow = "1.0.0"

    async-trait = "0.1.51"

    http = "1.0.0"

    serde = "1.0.106"

    thiserror = "1.0.21"

    tower-service = "0.3.0"


