    version = "0.12.0"

    features = ["rustls-tls"]


    [dev-dependencies.reqwest-retry]

    path = "../reqwest-retry"


    [dev-dependencies.reqwest-tracing]

    path = "../reqwest-tracing"


    [dev-dependencies.tokio]

    version = "1.0.0"

    features = ["macros", "rt-multi-thread"]

